髪に自然なツヤを与え、しなやかにまとめる。無香料ヘアクリームオイル。<br><br><br>ルシード ヘアクリームオイル 200ml<br>複数のオイル成分をバランスよく配合。パサつく髪にみずみずしいツヤを与え、しなやかにまとめる男性用スタイリングクリームです。ウォーターベースで、サラッとベタつかない使用感。無香料なので、髪に香りを残しません。<br> 成分<br>水、ミネラルオイル、ジメチコン、ポリソルベート60、ワセリン、DPG、ステアリン酸ソルビタン、セタノール、TEA、カルボマー、ヒドロキシエチルセルロース、EDTA-2ナトリウム、オキシベンゾン-5、フェノキシエタノール、メチルパラベン、プロピルパラベン  <br>販売_製造元： マンダム<br>ブランド：ルシード<br>JAN：4902806221169<br>CS：24<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
